import './App.css';
import Home from './components/Home'
import {Route, Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
     <Routes>
     <Route
     path = '/home'
     render = {()=> <Home/>}
     />
     </Routes>
    </div>
  );
}

export default App;
